import ReactDOM from 'react-dom/client'
import { useState } from 'react'

import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
  Navigate,
  useParams,
  useNavigate,
} from "react-router-dom"

const Home = () => (
  <div>
    <h2>Semilleros EAN</h2>
    <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>
  </div>
)

const Workshops = ({ workshops, researchGroups }) => {
  return (
    <div>
      <table>
        <tr>
          <th>Nombre</th>
          <th>Objetivo</th>
          <th>Grupo de Investigación</th>
          <th>Ver</th>
        </tr>
        {workshops.map(
          workshop => {
            return (
              <tr key={workshop.id}>
                <td>{workshop.name}</td>
                <td>{workshop.objective}</td>
                <td>{researchGroups.find(researchGroup => researchGroup.id = workshop.id)}</td>
                <td><button>Ver</button></td>
              </tr>
            )
          }
        )}
      </table>
    </div>
  )
}

const App = () => {

  const [workshops, setWorkshops] = useState([
    {
      id: 1,
      name: 'Domus',
      objective: 'Desarrollar procesos de investigación estudiantil, que soporten el enfoque del grupo Entorno Económico. Es decir, que expliquen el entorno local e internacional de las organizaciones, con el fin de promover acciones concretas que contribuyan al desarrollo económico y social de las sociedades.',
      research_group: 3
    }
  ])

  const [ researchGroups, setResearchGroups ] = useState([
    {
      id: 1,
      name: 'Entrepeneurship Group'
    },
    {
      id: 2,
      name: 'Grupo de gerencia en las grandes, pequeñas y medianas empresas -G3Pymes'
    },
    {
      id: 3,
      name: 'Entorno Económico de las organizaciones'
    },
    {
      id: 4,
      name: 'Dirección & gestión de proyectos'
    },
    {
      id: 5,
      name: 'Grupo de investigación y desarrollo Tecnológico ONTARE'
    },
    {
      id: 6,
      name: 'Gestión Ambiental'
    },
    {
      id: 7,
      name: 'Ciencias Básicas'
    },
    {
      id: 8,
      nam: 'GIS (Grupo de Investigación en Salud)'
    },
    {
      id: 9,
      name: 'INDEVOS'
    },
    {
      id: 10,
      name: 'Lingüística y comunicación Organizacional'
    },
    {
      id: 11,
      name: 'Política y Sostenibilidad'
    },
    {
      id: 12,
      name:'Ambientes de Aprendizaje'
    }
  ])

  const padding = {
    padding: 5
  }

  return (
    <Router>
      <div>
        <Link style={padding} to="/">home</Link>
        <Link style={padding} to="/workshops">workshops</Link>
      </div>

      <Routes>
        <Route path="/workshops" element={<Workshops workshops={workshops} researchGroups={researchGroups} />} />
        <Route path="/" element={<Home />} />
      </Routes>
    </Router>
  )
}



export default App
